This method accepts the original as well as the mutated object. It then retrieved the Attribute level privilege using the object's name. Using this privilege access map it checks if the attributes on which the {@link User} doesnt have access has been modified in the mutated object. If found then it replaces the value of the same back from the original object. Thus this methods doesnt allow modification of attributes of an object on which the user doesnt have access. This new object is returned which contains the changed values only for those attributes on which the User has access.
