<pre> hibernate.connection.url - The url of the CSM Authorization database hibernate.connection.username - The username for the database hibernate.connection.password - The password for the database hibernate.dialect - The hibernate dialect to be used based on the database eg. MySQL, Oracle hibernate.connection.driver_class - The driver class to be used to connect to the database.
</pre> 
</blockquote>
